export default function Row({onClickLoading, onClickClear}) {
    return (
        <div>

        <button onClick={onClickLoading}>Загрузить</button>
        <button onClickClear={onClickClear}>Очистить</button>
        <button>Группировать</button>

      </div>
    );
  }
